import React from 'react'
import PropTypes from 'prop-types'

export default function Navbar(props) {
  const handleToggleClick = (theme) => {
    if(theme === 'light'){
      props.toggleMode('light');
    }
    if(theme === 'dark'){
      props.toggleMode('dark');
    }
    if(theme === 'primary'){
      props.toggleMode('primary');
    }
  }
  return (
    <nav className={`navbar navbar-expand-lg navbar-${props.mode} bg-${props.mode}`}>
    <div className="container-fluid">
      <a className="navbar-brand" href="/">{props.title}</a>
      <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
          <li className="nav-item">
            <a className="nav-link active" aria-current="page" href="/">{props.home}</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="/">{props.about}</a>
          </li>              
        </ul>
        {/* <form className="d-flex" role="search">
          <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
          <button className="btn btn-outline-success" type="submit">Search</button>
        </form> */}
        <div className={`form-check form-switch text-${(props.mode === 'light')? 'dark' : 'light'}`}>
          <input className="form-check-input" type="checkbox" onClick={handleToggleClick('dark')} role="switch" id="flexSwitchCheckDefault"/>
          <label className="form-check-label" htmlFor="flexSwitchCheckDefault">Enable {(props.mode === 'light')? 'dark' : 'light'} mode</label>
        </div>
      </div>
    </div>
  </nav>
  )
}
Navbar.propTypes = {title: PropTypes.string.isRequired};
Navbar.defaultProps = {title: 'Give a title', home: 'Home', about: 'About'};
